export const mapParams = {
    width: 300,
    height: 300
}

const drawMap = (context:CanvasRenderingContext2D) => {
    context.beginPath()
    context.moveTo(0, 50)
    context.lineTo(mapParams.width, 50)
    context.moveTo(100, 0)
    context.lineTo(mapParams.width, 100)
    //context.lineTo(30, 100)
    context.fill()
}

export default drawMap;
